import styled from 'styled-components'

export const Bigbox = styled.div`
  border: 0.5px solid #c4c4c4;
  /* border-top-color: #fff; */
  font-size: 24px;
  display: flex;
  justify-content: space-between;
  align-items: center;
  padding: 30px;
  height: 100px;
`
